import React, { useState, useEffect } from 'react';
import axios from 'axios';
import data from "./Card.json";
import Card from '@mui/material/Card';
import CardActions from '@mui/material/CardActions';
import CardContent from '@mui/material/CardContent';
import CardMedia from '@mui/material/CardMedia';
import Button from '@mui/material/Button';
import Typography from '@mui/material/Typography';

const  Carwithapi=()=> {
  const [movie, setmovie] = useState([]);

  useEffect(() => {
    axios.get('http://www.omdbapi.com/?s="love"&y=2024&type=movie&apikey=ff8166a')

      .then(response => {
             
       setmovie(response.data.Search || []);
       
      })
      .catch(error => {
        console.error(error);
      });
       
       
  }, []);
 
  return (
     <div className="container">
    <div className="row">
   {movie.map((mv, index)=> (
          <div className="col-md-3 mb-4" key={index}>
         <div className="card h-100">
  <img className="card-img-top" src={mv.Poster} alt="Card image"/>
  <div className="card-body">
    <h4 className="card-title">{mv.t}</h4>
    <p className="card-text">Release Year{mv.Year}</p>
    <a href="#" className="btn btn-primary">{mv.imdbID}</a>
  </div>  </div>
</div>
  )

         )
            
   }
     </div>  </div>
      
   
  );
}

export default Carwithapi;
